function d3_sgn(n){return n>0?1:n<0?-1:0}function d3_acos(n){return n>1?0:n<-1?π:Math.acos(n)}function d3_asin(n){return n>1?π/2:n<-1?-π/2:Math.asin(n)}function d3_sinh(n){return(Math.exp(n)-Math.exp(-n))/2}function d3_cosh(n){return(Math.exp(n)+Math.exp(-n))/2}function d3_haversin(n){return(n=Math.sin(n/2))*n}var π=Math.PI,ε=1e-6,ε2=ε*ε,d3_radians=π/180,d3_degrees=180/π;